import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (

            <header>

                <div id="banner" style={ myheader }>
<pre> {`
████████╗ █████╗ ███████╗ █████╗ ██╗     ██╗
╚══██╔══╝██╔══██╗██╔════╝██╔══██╗██║     ██║
   ██║   ███████║███████╗███████║██║     ██║
   ██║   ██╔══██║╚════██║██╔══██║██║     ██║
   ██║   ██║  ██║███████║██║  ██║███████╗██║
   ╚═╝   ╚═╝  ╚═╝╚══════╝╚═╝  ╚═╝╚══════╝╚═╝
   `}
</pre>
<p style={{fontFamily: 'Comic\ Sans'}}>Tasnim Ali</p>
</div>


<div class="menu" >
    <ul> 
        <li style={{   display: 'inline' }}><a href='/'> Home </a></li>
        <li style={{   display: 'inline' }}><a href='/'> Archive </a></li>
        <li style={{   display: 'inline' }}><a href='/'> whoami </a></li>
    </ul>
</div>

</header>

        );
    }
}



const myheader = {
    fontSize: '20px'
  };





export default Header;
